static string[] _CrackArgs(string arguments, char esc = '\\', out string exename)
{
    exename = null;
    var result = new List<string>();
    var i = 0;
    var inQuote = false;
    var sb = new StringBuilder();
    while (i < arguments.Length) {
        if (!inQuote) {
            if (sb.Length == 0)
            {
                if (arguments[i] == '"')
                {
                    inQuote = true;
                    ++i;
                    continue;
                }
            }
            var ws = false;
            while (char.IsWhiteSpace(arguments[i]))
            {
                ws = true;
                ++i;
            }
            if (ws)
            {
                if (sb.Length > 0)
                {
                    if (exename == null)
                    {
                        exename = sb.ToString();
                    }
                    else
                    {
                        result.Add(sb.ToString());
                    }
                    sb.Clear();
                }
            }
            else
            {
                sb.Append(arguments[i]);
                ++i;
            }
            
        } else
        {
            if (i < arguments.Length - 1 && arguments[i] == esc && arguments[i + 1] == '\"')
            {
                sb.Append('\"');
                i += 2;
            } else if (arguments[i] == '\"')
            {
                if (exename == null)
                {
                    exename = sb.ToString();
                }
                else
                {
                    result.Add(sb.ToString());
                }
                sb.Clear();
                inQuote = false;
                ++i;
            }
            sb.Append(arguments[i]);
            ++i;
        }
    }
    if (sb.Length > 0)
    {
        if (exename == null)
        {
            exename = sb.ToString();
        }
        else
        {
            result.Add(sb.ToString());
        }
    }
    return result.ToArray();
}

