 bool cookies(int n,int c,int k,vector<int>&a,vector<int>&b){
  int d=0;
  for(int i=0;i<n;i++){
    if(b[i]/a[i]<c){
      d=c-(b[i]/a[i]);
      if(d==1){
        if(k-(a[i]-(b[i]%a[i]))>=0){
          b[i]+=(a[i]-(b[i]%a[i]));
          k-=(a[i]-(b[i]%a[i]));
        }else{
          return false;
        }
      }else{
        if(k-(a[i]-(b[i]%a[i]))>=0){
          b[i]+=(a[i]-(b[i]%a[i]));
          k-=(a[i]-(b[i]%a[i]));
        }else{
          return false;
        }
        d--;
        if(k-(a[i]*d)>=0){
          b[i]+=(a[i]*d);
          k-=(a[i]*d);
        }else{
          return false;
        }
      }
    }else{
      return true;
    }
  }return true;
 }

