    sort(L10List.begin(), L10List.end(), greater<int>());
    sort(L16List.begin(), L16List.end(), greater<int>());

    int sum = 0;
    for(int i = 0; i < min(L10, L10List.size()); i++) {
        sum = sum + L10List.at(i);
    }

    for(int i = 0; i < L16List.size(); i++) {
        sum = sum + L16List.at(i);
    }

    vector<int> avanzo;

