        avanzo.push_back(L10List.at(i));
    }

    for(int i = L16; i < L16List.size(); i++) {
        avanzo.push_back(L16List.at(i));
    }

    sort(avanzo.begin(), avanzo.end(), greater<int>());

    for(int i = 0; i < min(bipasso, avanzo.size()); i++) {
        sum = sum + avanzo.at(i);
    }

    cout << sum;
